pragma solidity ^0.6.6;

import './Transactions.sol';

contract Medicine {

    address Owner;

    enum medicineStatus {
        atManufacturer,
        pickedForW,
        pickedForD,
        deliveredAtW,
        deliveredAtD,
        pickedForC,
        deliveredAtC
    }

    bytes32 description;
    address[] rawMaterials;
    address[] transporters;
    address manufacturer;
    address wholesaler;
    address distributor;
    address customer;
    uint quantity;
    medicineStatus status;
    address txnContractAddress;

    event ShippmentUpdate(
        address indexed BatchID,
        address indexed Shipper,
        address indexed Receiver,
        uint TransporterType,
        uint Status
    );


    constructor(
        address _manufacturerAddr,
        bytes32 _description,
        address[] memory _rawAddr,
        uint _quantity,
        address[] memory _transporterAddr,
        address _receiverAddr,
        uint RcvrType
    ) public {
        Owner = _manufacturerAddr;
        manufacturer = _manufacturerAddr;
        description = _description;
        rawMaterials = _rawAddr;
        quantity = _quantity;
        transporters = _transporterAddr;
        if(RcvrType == 1) {
            wholesaler = _receiverAddr;
        } else if( RcvrType == 2){
            distributor = _receiverAddr;
        }
        Transactions txnContract = new Transactions(_manufacturerAddr);
        txnContractAddress = address(txnContract);
    }


    function getMedicineInfo () public view returns(
        address _manufacturerAddr,
        bytes32 _description,
        address[] memory _rawAddr,
        uint _quantity,
        address[] memory _transporterAddr,
        address _distributor,
        address _customer
    ) {
        return(
            manufacturer,
            description,
            rawMaterials,
            quantity,
            transporters,
            distributor,
            customer
        );
    }


    function getWDC() public view returns(
        address[3] memory WDP
    ) {
        return (
            [wholesaler, distributor, customer]
        );
    }

    function getBatchIDStatus() public view returns(
        uint
    ) {
        return uint(status);
    }


    function pickMedicine(
        address _transporterAddr
    ) public {
        require(
            _transporterAddr == transporters[transporters.length - 1],
            "Only Transporter can call this function"
        );
        require(
            status == medicineStatus(0),
            "Package must be at Manufacturer."
        );

        if(wholesaler != address(0x0)){
            status = medicineStatus(1);
            emit ShippmentUpdate(address(this), _transporterAddr, wholesaler, 1, 1);
        }else{
            status = medicineStatus(2);
            emit ShippmentUpdate(address(this), _transporterAddr, distributor, 1, 2);
        }
    }

    function updateTransporterArray(address _transporterAddr) public {
        transporters.push(_transporterAddr);
    }


    function receivedMedicine(
        address _receiverAddr
    ) public
    returns(uint)
    {

        require(
            _receiverAddr == wholesaler || _receiverAddr == distributor,
            "Only Wholesaler or Distributor can call this function"
        );

        require(
            uint(status) >= 1,
            "Product not picked up yet"
        );

        if(_receiverAddr == wholesaler && status == medicineStatus(1)){
            status = medicineStatus(3);
            emit ShippmentUpdate(address(this), transporters[transporters.length - 1], wholesaler, 2, 3);
            return 1;
        } else if(_receiverAddr == distributor && status == medicineStatus(2)){
            status = medicineStatus(4);
            emit ShippmentUpdate(address(this), transporters[transporters.length - 1], distributor,3, 4);
            return 2;
        }
    }


    function sendWtoD(
        address receiver,
        address sender
    ) public {
        require(
            wholesaler == sender,
            "this Wholesaler is not Associated."
        );
        distributor = receiver;
        status = medicineStatus(2);
    }


    function receivedWtoD(
        address receiver
    ) public {
        require(
            distributor == receiver,
            "This Distributor is not Associated."
        );
        status = medicineStatus(4);
    }


    function sendDtoC(
        address receiver,
        address sender
    ) public {
        require(
            distributor == sender,
            "This Distributor is not Associated."
        );
        customer = receiver;
        status = medicineStatus(5);
    }


    function receivedDtoC(
        address receiver
    ) public {
        require(
            customer == receiver,
            "This Customer is not Associated."
        );
        status = medicineStatus(6);
    }
}

contracts/Transactions.sol.content:
pragma solidity ^0.6.6;
pragma experimental ABIEncoderV2;

contract Transactions {

    address Creator;

    struct txns {
        bytes32 txnHash;
        address fromAddr;
        address toAddr;
        bytes32 prevTxn;
        string latitude;
        string longitude;
        uint timestamp;
    }

    mapping(uint => txns) public transactions;
    uint public txnCount = 0;

    constructor(address _creator) public {
        Creator = _creator;
    }

    event txnCreated(bytes32 _txnHash, address _from, address _to, bytes32 _prev, uint _timestamp, string _latitude, string _longitude);

    function createTxnEntry(bytes32 _txnHash, address _from, address _to, bytes32 _prev, string memory _latitude, string memory _longitude) public {
        uint _timestamp = now;
        if(txnCount == 0) {
            transactions[txnCount] = txns(_txnHash, _from, _to, _prev, _latitude, _longitude, _timestamp);
        } else {
            require(transactions[txnCount - 1].txnHash == _prev, "Transaction error occurred!");
            transactions[txnCount] = txns(_txnHash, _from, _to, _prev, _latitude, _longitude, _timestamp);
        }
        txnCount += 1;
        emit txnCreated(_txnHash, _from, _to, _prev, _timestamp, _latitude, _longitude);
    }

    function getAllTransactions() public view returns(txns[] memory) {
        uint len = txnCount;
        txns[] memory ret = new txns[](len);
        for (uint i = 0; i < len; i++) {
            ret[i] = transactions[i];
        }
        return ret;    
    }
}
